import React, { useState } from 'react';
import './style.css';

function AddButton() {
  const [name, setName] = useState(0);
  let arys:[]=[]
  const logs = ()=>{
    setName(name+1);
    let arg = [...Array(name)].map((_,i) => i+1)
    Array.prototype.push.apply(arys, arg)
    console.log(arys)
    const rendDivBtn = arys.map((counkey:number) => {
        return <div className="divbtn" key={counkey.toString()}>{name}</div>
        })
  }

  return (
    <div>
      <h2>増えるボタン</h2>
      <div className="divbtn" onClick={logs}>{name}</div>
      {rendDivBtn}
    </div>
  );
}

export default AddButton;
